import React, { useEffect, useState } from "react";
import axios from "axios";
import dayjs from "dayjs";
import TopBar from "../components/TopBar";
import { FaCheck, FaTimes } from "react-icons/fa";

function TablingLogs() {
  const [logs, setLogs] = useState([]);
  const [orgs, setOrgs] = useState([]);
  const [selectedDate, setSelectedDate] = useState(dayjs().format("YYYY-MM-DD"));
  const [selectedOrg, setSelectedOrg] = useState("All");
  const [selectedAction, setSelectedAction] = useState("All");
  const [selectedNoShow, setSelectedNoShow] = useState("All");
  const [searchQuery, setSearchQuery] = useState("");

  useEffect(() => {
    axios.get("/api/organizations/all-logs").then((res) => {
      setLogs(res.data);
      const orgNames = res.data.map((org) => org.name);
      setOrgs(orgNames);
    });
  }, []);

  const grouped = {};

  logs.forEach((org) => {
    org.reservations.forEach((r) => {
      if (!grouped[r.eventNumber]) grouped[r.eventNumber] = { org: org.name, logs: [] };
      grouped[r.eventNumber].logs.push({ ...r });
    });
  });

  const allRows = Object.entries(grouped)
    .map(([eventNumber, { org, logs }]) => {
      const checkIn = logs.find((r) => r.action === "check_in");
      const checkOut = logs.find((r) => r.action === "check_out");
      const noShow = logs.find((r) => r.action === "no_show");

      return {
        date: dayjs(checkIn?.checkInTime || checkOut?.checkOutTime || noShow?.rangeStart).format("YYYY-MM-DD"),
        action: noShow ? "No Show" : checkOut ? "Check Out" : "Check In",
        eventNumber,
        organization: org,
        clientName: checkIn?.clientName || checkOut?.clientName || "",
        tablingSpot: checkIn?.tablingSpot || checkOut?.tablingSpot || noShow?.tablingSpot || "",
        checkInTime: checkIn?.checkInTime ? dayjs(checkIn.checkInTime).format("h:mm A") : "-",
        checkOutTime: checkOut?.checkOutTime ? dayjs(checkOut.checkOutTime).format("h:mm A") : "-",
        noShow: noShow ? true : false,
        user: checkOut?.user || checkIn?.user || noShow?.user || "-",
        tables: checkIn?.table?.barcode || checkOut?.table?.barcode || "-",
        chairs:
          checkIn?.chairs?.map((c) => c.barcode).join(", ") ||
          checkOut?.chairs?.map((c) => c.barcode).join(", ") ||
          "-",
        notes: checkOut?.notes || checkIn?.notes || noShow?.notes || "N/A",
      };
    })
    .filter((row) => {
      const matchesDate = row.date === selectedDate;
      const matchesOrg = selectedOrg === "All" || row.organization === selectedOrg;
      const matchesAction =
        selectedAction === "All" ||
        (selectedAction === "Check In" && row.action === "Check In") ||
        (selectedAction === "Check Out" && row.action === "Check Out") ||
        (selectedAction === "No Show" && row.action === "No Show");
      const matchesNoShow =
        selectedNoShow === "All" ||
        (selectedNoShow === "Yes" && row.noShow) ||
        (selectedNoShow === "No" && !row.noShow);
      const searchLower = searchQuery.toLowerCase();
      const matchesSearch =
        row.clientName.toLowerCase().includes(searchLower) ||
        row.eventNumber.toLowerCase().includes(searchLower) ||
        row.tablingSpot.toLowerCase().includes(searchLower) ||
        row.user.toLowerCase().includes(searchLower) ||
        row.notes.toLowerCase().includes(searchLower);
      return matchesDate && matchesOrg && matchesAction && matchesNoShow && matchesSearch;
    });

  return (
    <div className="min-h-screen bg-gray-900 text-white">
      <TopBar />
      <div className="p-6">
        <h2 className="text-3xl font-bold mb-4 text-asuGold text-center">Tabling Logs</h2>

        <div className="flex flex-wrap gap-4 mb-4 justify-center">
          <input
            type="date"
            value={selectedDate}
            onChange={(e) => setSelectedDate(e.target.value)}
            className="p-2 rounded bg-gray-800 border border-gray-600"
          />
          <select value={selectedOrg} onChange={(e) => setSelectedOrg(e.target.value)} className="p-2 rounded bg-gray-800 border border-gray-600">
            <option value="All">All Organizations</option>
            {orgs.map((o) => (
              <option key={o} value={o}>
                {o}
              </option>
            ))}
          </select>
          <select value={selectedAction} onChange={(e) => setSelectedAction(e.target.value)} className="p-2 rounded bg-gray-800 border border-gray-600">
            <option value="All">All Actions</option>
            <option value="Check In">Check In</option>
            <option value="Check Out">Check Out</option>
            <option value="No Show">No Show</option>
          </select>
          <select value={selectedNoShow} onChange={(e) => setSelectedNoShow(e.target.value)} className="p-2 rounded bg-gray-800 border border-gray-600">
            <option value="All">All</option>
            <option value="Yes">No Show: Yes</option>
            <option value="No">No Show: No</option>
          </select>
          <input
            type="text"
            placeholder="Search client, event, spot..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            className="p-2 rounded bg-gray-800 border border-gray-600 w-80"
          />
        </div>

        <div className="overflow-x-auto mt-4">
          <table className="w-full border-collapse">
            <thead className="bg-asuMaroon text-white text-sm">
              <tr>
                <th className="p-2">Date</th>
                <th className="p-2">Action</th>
                <th className="p-2">Event #</th>
                <th className="p-2">Organization</th>
                <th className="p-2">Client</th>
                <th className="p-2">Spot</th>
                <th className="p-2">Check-In</th>
                <th className="p-2">Check-Out</th>
                <th className="p-2">No Show</th>
                <th className="p-2">User</th>
                <th className="p-2">Tables</th>
                <th className="p-2">Chairs</th>
                <th className="p-2">Notes</th>
              </tr>
            </thead>
            <tbody>
              {allRows.length === 0 ? (
                <tr>
                  <td colSpan={13} className="text-center text-gray-400 p-6">
                    No tabling logs match the selected filters.
                  </td>
                </tr>
              ) : (
                allRows.map((log, idx) => (
                  <tr key={idx} className="text-sm text-center border-b border-gray-700">
                    <td className="p-2">{dayjs(log.date).format("MMM D, YYYY")}</td>
                    <td className="p-2">{log.action}</td>
                    <td className="p-2">{log.eventNumber}</td>
                    <td className="p-2">{log.organization}</td>
                    <td className="p-2">{log.clientName}</td>
                    <td className="p-2">{log.tablingSpot}</td>
                    <td className="p-2">{log.checkInTime}</td>
                    <td className="p-2">{log.checkOutTime}</td>
                    <td className="p-2">
                      {log.noShow ? (
                        <span className="bg-green-600 text-white px-2 py-1 rounded-full text-xs">Yes</span>
                      ) : (
                        <span className="bg-red-600 text-white px-2 py-1 rounded-full text-xs">No</span>
                      )}
                    </td>
                    <td className="p-2">{log.user}</td>
                    <td className="p-2">
                      {log.tables !== "-" ? `Yes 1 table (${log.tables})` : "-"}
                    </td>
                    <td className="p-2">
                      {log.chairs !== "-" ? `Yes ${log.chairs.split(",").length} chairs (${log.chairs})` : "-"}
                    </td>
                    <td className="p-2">{log.notes}</td>
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default TablingLogs;
